define({"topics" : [{"title":"Introduction to project subscription","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">By subscribing to other projects, you can avoid         duplication of effort and allow your project to avail itself of the\n                           actions, data sets,         interface definitions and picture checks that already reside in those projects.</span></p>\n                  ","id":"Project_subscription_intro","href":"TA_Help\/Topics\/Project_subscription_intro.html","menu": {"hasChildren":false,},"tocID":"Project_subscription_intro-d46e20589","topics":[]},{"title":"Subscribing to projects","shortdesc":"\n                     <p class=\"shortdesc\">How to have your project subscribe to another.</p>\n                  ","id":"Subscribe_to_projects","href":"TA_Help\/Topics\/Projects_and_project_items_subscribe_to_projects.html","menu": {"hasChildren":false,},"tocID":"Subscribe_to_projects-d46e20601","topics":[]},{"title":"Subscription rules","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\"><span class=\"ph\">TestArchitect</span> employs a         depth-first search (DFS) algorithm to locate, among subscribed projects, the definitions for         actions,\n                           interface entities, interface elements, data sets, and picture checks.</span></p>\n                  ","id":"Project_subscription_rules","href":"TA_Help\/Topics\/Project_subscription_rules.html","menu": {"hasChildren":false,},"tocID":"Project_subscription_rules-d46e20612","topics":[]}]});